DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders`  (
  `orderId` int(11) NOT NULL COMMENT '主键id',
  `userId` mediumint(8) NOT NULL COMMENT '下订单会员id',
  `orderNumber` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `createTime` int(15) NOT NULL COMMENT '订单下单时间',
  `orderPay` enum('0','1','2','3') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '支付方式 0未支付 1微信 2支付宝 3银行卡',
  `goodsPrice` decimal(10, 2) NOT NULL COMMENT '商品金额',
  `peisongPrice` decimal(10, 2) NOT NULL COMMENT '配送费',
  `realityPrice` decimal(10, 2) NOT NULL COMMENT '实付金额',
  `goodsCount` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品数量',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收货地址',
  `payStatus` enum('0','1','2','3','4','5') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单状态 0待支付 1待分拣 2待配送 3配送中 4交易完成 5 交易关闭',
  `updateTime` int(15) NOT NULL COMMENT '订单更新时间',
  `isSend` enum('是','否') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品是否发货',
  PRIMARY KEY (`orderId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

